import React from "react"
import Card from "./Card"


export default function Gallery() {

    const options = {
        method: 'GET',
        headers: {
            'X-RapidAPI-Key': '2k4fcplng63si9h1enc3yq8fnv6ogkpg74pbo91a',
            'X-RapidAPI-Host': 'https://api.json-generator.com/'
        }
    };

    fetch('https://api.json-generator.com/templates/TZ945seVmWP4/data', options)
        .then(response => response.json())
        .then(data => console.log(data))
        .catch(err => console.error(err));

    return (
        <div className="wrapper">
           <h3 className="wrapper-text">Connect people and spaces</h3> 
           <Card />
        </div>
    )
}
